import React from 'react';
import './propstesting.scss';

function Profile(props) {
  return (
    <div>
      <thead>
        <tr>
          <th>名前</th>
          <th>血液型</th>
        </tr>
      </thead>
      <tbody>
        <tr>
        <td> { props.name }</td>
        <td> {props.type }</td>
        </tr>
      </tbody>
    </div>
  )
}

const PropsTesting = ({ text, backgroundColor, ...props}) => {
  const plofiles = [
      {id: 1, name: 'はるか'},
      {id: 2, name: 'だいき'},
      {id: 3, name: 'あい'}
    ];
       return(
           <div>
              <div className="bg-color" style={backgroundColor && { backgroundColor }}
                  {...props}>
                  { text }
              </div>
                  <tr>
                      {plofiles.map((profile) => <Profile key={profile.id} name={profile.name} />)}
                  </tr>
           </div>

       );
}


export default PropsTesting;
